// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

import "./ERC2981/ERC2981PerTokenRoyalties.sol";

contract DynaStripes is ERC721, ERC721Enumerable, ERC721URIStorage, Pausable, AccessControl, ERC721Burnable, ERC2981PerTokenRoyalties {
    using Counters for Counters.Counter;

    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    uint16 public constant TOKEN_LIMIT = 5000;
    uint16 public constant ROYALTY_BPS = 1000;
    uint256 public constant BASE_MINT_PRICE = 0.01 ether;

    Counters.Counter private _tokenIdCounter;

    constructor() ERC721("DynaStripes", "DSS") {
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(PAUSER_ROLE, msg.sender);
        _setupRole(MINTER_ROLE, msg.sender);
    }

    function pause() public onlyRole(PAUSER_ROLE) {
        _pause();
    }

    function unpause() public onlyRole(PAUSER_ROLE) {
        _unpause();
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId)
        internal
        whenNotPaused
        override(ERC721, ERC721Enumerable)
    {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    // The following functions are overrides required by Solidity.

    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721, ERC721URIStorage)
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, ERC721Enumerable, AccessControl, ERC2981PerTokenRoyalties)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    // CUSTOM FUNCTIONS

    function currentMintPrice() public view returns (uint256) {
        return BASE_MINT_PRICE + (totalSupply() / 100) * BASE_MINT_PRICE;
    }

    // TODO: covert params to uint8?
    struct DynaParams {
        uint32 randomSeed;
        uint8 rotationDegreesMin; // 0 - 180
        uint8 rotationDegreesMax; // 0 - 180
        uint8 stripeWidthMin; // 0 - 255
        uint8 stripeWidthMax; // 0 - 255
        uint8 paletteMin; // 0 - 255Â 
        uint8 paletteMax; // 0 - 255
        uint8 speedMin; // 20 - 255 
        uint8 speedMax; // 0 - 255
    }

    mapping(uint256 => DynaParams) private dynaParamsMapping;

    function isSenderAdmin() public view returns (bool) {
        return hasRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    function mintStripes(uint32 _randomSeed, 
                         uint8 _rotationDegreesMin, 
                         uint8 _rotationDegreesMax, 
                         uint8 _stripeWidthMin, 
                         uint8 _stripeWidthMax, 
                         uint8 _paletteMin, 
                         uint8 _paletteMax, 
                         uint8 _speedMin, 
                         uint8 _speedMax) public payable {
        uint256 tokenId = _tokenIdCounter.current();
        require(tokenId < TOKEN_LIMIT, "All tokens minted.");
        require(msg.value >= currentMintPrice(), "Not enough ether.");
        require(_rotationDegreesMin >= 0 && _rotationDegreesMax <= 180 && _rotationDegreesMin <= _rotationDegreesMax, "Rotation must be between 0 and 180.");
        // TODO: you don't need to check upper bounds? as solidity will throw error if uint8 can't hold value
        require(_stripeWidthMin >= 0 && _stripeWidthMax <= 255 && _stripeWidthMin <= _stripeWidthMax, "Stripe width must be between 0 and 255.");
        require(_paletteMin >= 0 && _paletteMax <= 255 && _paletteMin <= _paletteMax, "Palette value must be between 0 and 255.");
        require(_speedMin >= 20 && _speedMax <= 255 && _speedMin <= _speedMax, "Speed value must be between 20 and 255.");

        _safeMint(msg.sender, tokenId);
        _setTokenRoyalty(tokenId, msg.sender, ROYALTY_BPS);

        dynaParamsMapping[tokenId] = DynaParams(_randomSeed, _rotationDegreesMin, _rotationDegreesMax, _stripeWidthMin, _stripeWidthMax, _paletteMin, _paletteMax, _speedMin, _speedMax);

        _tokenIdCounter.increment();
    }

    function uint2str(uint _i) internal pure returns (string memory _uintAsString) {
        if (_i == 0) {
            return "0";
        }
        uint j = _i;
        uint len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint k = len;
        while (_i != 0) {
            k = k-1;
            uint8 temp = (48 + uint8(_i - _i / 10 * 10));
            bytes1 b1 = bytes1(temp);
            bstr[k] = b1;
            _i /= 10;
        }
        return string(bstr);
    }

    function randomIntFromInterval(uint256 _randomSeed, uint16 _min, uint16 _max) private pure returns (uint16) {
        if (_max <= _min) {
            return _min;
        }
        return uint16(_randomSeed % (_max - _min)) + _min;
    }

    // from https://github.com/GNSPS/solidity-bytes-utils/blob/master/contracts/BytesLib.sol
    // function toUint256(bytes memory _bytes, uint256 _start) internal pure returns (uint256) {
    //     require(_bytes.length >= _start + 32, "toUint256_outOfBounds");
    //     uint256 tempUint;

    //     assembly {
    //         tempUint := mload(add(add(_bytes, 0x20), _start))
    //     }

    //     return tempUint;
    // }

    function generateSvg(uint256 _tokenId) public view returns (string memory) {
        // TODO: user could still determine what next token would look like...
        require(_tokenId < _tokenIdCounter.current(), "Attempted to generate SVG for token that has not yet been minted.");

        DynaParams memory dynaParams = dynaParamsMapping[_tokenId];

        uint16 xPos = 0;
        uint16 maxWidth = 2000;
        uint256 randomSeed = dynaParams.randomSeed;

        string memory svg = "<svg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 2000 2000'>";

        while ((maxWidth - xPos) > 0) {
            uint16 stripeWidth = randomIntFromInterval(randomSeed, dynaParams.stripeWidthMin, dynaParams.stripeWidthMax) + 50;
            if ((maxWidth - xPos) < stripeWidth) {
                stripeWidth = (maxWidth - xPos);
            }

            uint16 rotation = randomIntFromInterval(randomSeed, dynaParams.rotationDegreesMin, dynaParams.rotationDegreesMax);
            uint16 speed = randomIntFromInterval(randomSeed, dynaParams.speedMin, dynaParams.speedMax) * 10;

            string memory rect = string(abi.encodePacked("<rect x='", uint2str(xPos), "' y='0' width='", uint2str(stripeWidth), "' height='2000' shape-rendering='crispEdges'  opacity='0.8'", " transform='rotate(",  uint2str(rotation)," 1000 1000)'><animate begin= '0s' dur='", uint2str(speed), "ms' attributeName='fill' values='",  getColours(randomSeed, dynaParams.paletteMin, dynaParams.paletteMax), "' fill='freeze' repeatCount='indefinite'/></rect>"));
            svg = string(abi.encodePacked(svg, rect));
            xPos += stripeWidth;
            randomSeed += xPos;

        }

        svg = string(abi.encodePacked(svg, "</svg>"));

        return svg;
    }

    function getColours(uint256 _randomSeed, uint8 _paletteMin, uint8 _paletteMax) private pure returns (string memory) {
        string memory firstColour = getColour(_randomSeed, _paletteMin, _paletteMax);
        string memory secondColour = getColour(_randomSeed * 2, _paletteMin, _paletteMax);

        return string(abi.encodePacked(firstColour, ";", secondColour, ";", firstColour, ";"));
    }

    function getColour(uint256 _randomSeed, uint8 min, uint8 max) private pure returns (string memory) {
        uint256 red = randomIntFromInterval(_randomSeed, min, max);
        uint256 blue = randomIntFromInterval(_randomSeed * 2, min, max);
        uint256 green = randomIntFromInterval(_randomSeed * 3, min, max);

        return string(abi.encodePacked("rgb(", uint2str(red), ", ", uint2str(blue), ", ", uint2str(green), ")"));
    }

    // TODO: override tokenUri and add metadata, data URI.. see https://blog.simondlr.com/posts/flavours-of-on-chain-svg-nfts-on-ethereum   
}

